import React from 'react';

const mapper = function(availability) {

    return (
        <>
            <td className="col-md-2">{availability.nom}</td>
            <td className="col-md-2">{availability.prenom}</td>
            <td className="col-md-4">{availability.adressemail}</td>
            <td className="col-md-1">{availability.garage_fk}</td>
        </>
    );
};

export default mapper;
